import React from 'react';
import ForkTKM from '../assets/img/reactlogo.svg';

class MapMarker extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <img src={ForkTKM}
                 height="30rem"
                 width="20rem"
                 alt="map marker"/>
        )
    }
}

export default MapMarker;
